  \"2015-09-26T19:50:09.225838\",\n\t\"name\": \"2011-c-cap-land-cover-of-oahu-hawaii\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of land derived
  from high resolution imagery and was analyzed according to the Coastal Change Analysis
  Program (C-CAP) protocol to determine land cover. This data set utilized 48 full
  or partial WorldView2 multispectral scenes and the 2005 high-resolution Oahu C-CAP
  data set. The imagery and base classification were included in a multi-step semi-automated
  change detection process to extract land cover features in the 2011 imagery.\",\n\t\"license_title\":
